    return(
        <center>
            <div>Loan Info</div>
            <div>Amount: {props.loandata.amount}</div>
            <div>Number of Years: {props.loandata.numYears}</div>
            <div>Interest Rate: {props.interestRate}</div>
            <button onClick={props.onClose}>Close</button>
        </center>
    )
}

